import React from 'react';
import {
    MDBNavbar,
    MDBContainer,
    MDBIcon,
    MDBNavbarNav,
    MDBNavbarItem,
    MDBNavbarLink,
    MDBNavbarToggler,
    MDBNavbarBrand,
    MDBCollapse
  } from 'mdb-react-ui-kit';

import { Link } from 'react-router-dom';

const navbar = () => {
    return (

      <MDBNavbar expand='lg' dark bgColor='primary'>
        <MDBContainer fluid>
          <MDBNavbarBrand href='#'>
            <a class="navbar-brand" href='#'>
              <img src="/images/dcls.logo.png" height="30px" alt="" />
            </a>
          </MDBNavbarBrand>


        <MDBNavbarNav right>

        ยบ
        </MDBNavbarNav>

      </MDBContainer>
    </MDBNavbar>
    )
}

export default navbar;


